# Data for table "member"
#

INSERT INTO `member` VALUES (1,'최나영','940817','choinayoung7@naver.com','*3799BA80B386019BA42D9498F046D03FAD2F02FE',2,'012-3456-7891',0,'2019-01-16 16:47:03','2019-01-24 13:39:07',1,NULL),(3,'이아란','930210','aranrheearanrhee@gmail.com','*2CAB5335CA278D83AD99C66529B53E8FE987463C',2,'010-5344-5181',47000,'2019-01-16 17:30:24','2019-01-24 15:16:22',1,'reply_1548310592736.png'),(6,'이상윤','121212','tssu106@hanmail.net','*A8C21C30FE19317E3559D7D120CD98BB3669DDAC',1,'010-4567-1234',500,'2019-01-18 17:26:50','2019-01-22 17:32:21',1,'reply_1548145941175.gif'),(8,'이상윤','111111','tssu106@naver.com','*A8C21C30FE19317E3559D7D120CD98BB3669DDAC',1,'010-1111-1111',0,'2019-01-24 14:11:14','2019-01-24 14:11:14',1,NULL),(9,'test','111111','test@test','*3D3B92F242033365AE5BC6A8E6FC3E1679F4140A',1,'012-3456-7891',0,'2019-01-29 18:13:45','2019-01-29 18:13:45',1,'member_1548753225862.jpg'),(10,'막창왕김막창','190131','hi@hi.com','*805EBAABF96757E0218B0419F33BDEBE745649C5',2,'010-1234-5678',0,'2019-01-31 14:07:31','2019-01-31 14:56:24',1,'reply_1548914188955.png');

#
# Structure for table "movie"
#

CREATE TABLE `movie` (
  `no` int(11) NOT NULL AUTO_INCREMENT COMMENT '영화 일련번호',
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '영화 제목',
  `director` varchar(255) DEFAULT NULL COMMENT '감독',
  `genre` varchar(255) DEFAULT NULL COMMENT '장르',
  `rating` int(11) NOT NULL DEFAULT '0' COMMENT '등급',
  `format` varchar(255) DEFAULT NULL COMMENT '포맷',
  `runtime` int(11) NOT NULL DEFAULT '0' COMMENT '상영시간',
  `releaseDate` char(10) DEFAULT '' COMMENT '개봉일',
  `endDate` char(10) DEFAULT NULL COMMENT '상영종료일',
  `poster` varchar(255) DEFAULT NULL COMMENT '포스터',
  `display` int(11) NOT NULL DEFAULT '0' COMMENT '노출여부',
  `contents` text COMMENT '줄거리',
  `registDate` varchar(255) DEFAULT NULL COMMENT '등록일',
  `poster_chk` varchar(255) DEFAULT NULL COMMENT '삭제할때 받아올 파일이름값',
  `posterSize` int(11) DEFAULT '0' COMMENT '포스터 첨부파일 크기',
  PRIMARY KEY (`no`)
) ENGINE=InnoDB AUTO_INCREMENT=39 DEFAULT CHARSET=utf8;

