INSERT INTO `movie` VALUES (19,'말모이','엄유나','가족',12,'2D,3D,4D,IMAX',120,'2019-01-09','2019-02-18','movie_1548051618568.jpg',0,'<p>까막눈 판수, 우리말에 눈뜨다! vs 조선어학회 대표 정환, ‘우리’의 소중함에 눈뜨다!</p><p>1940년대 우리말이 점점 사라져가고 있는 경성.</p><p>극장에서 해고된 후 아들 학비 때문에 가방을 훔치다 실패한 판수.</p><p>하필 면접 보러 간 조선어학회 대표가 가방 주인 정환이다.</p><p>사전 만드는데 전과자에다 까막눈이라니!</p><p>그러나 판수를 반기는 회원들에 밀려 정환은 읽고 쓰기를 떼는 조건으로 그를 받아들인다.</p><p>돈도 아닌 말을 대체 왜 모으나 싶었던 판수는 난생처음 글을 읽으며 우리말의 소중함에 눈뜨고,</p><p>정환 또한 전국의 말을 모으는 ‘말모이’에 힘을 보태는 판수를 통해 ‘우리’의 소중함에 눈뜬다.</p><p>얼마 남지 않은 시간, 바짝 조여오는 일제의 감시를 피해 ‘말모이’를 끝내야 하는데…</p><p>&nbsp;</p><p>&nbsp;우리말이 금지된 시대, 말과 마음이 모여 사전이 되다​&nbsp;</p>',NULL,NULL,0),(20,'내안의 그놈','강효진','멜로',15,'2D',120,'2019-01-09','2019-02-15','movie_1548052093212.jpg',0,'<p>나 너니? 너 나니??</p><p>제대로 바뀐 아재와 고딩, 웃음 대환장 파티!</p><p>엘리트 아재 판수(박성웅)를 우연히 옥상에서 떨어진 고등학생 동현(진영)이 덮치면서 제대로 바뀐다.&nbsp;</p><p>게다가 판수는 동현의 몸으로 첫사랑 미선(라미란)과 존재도 몰랐던 딸 현정(이수민)을 만나게 되는데…&nbsp;</p><p>대유잼의 향연, 넌 이미 웃고 있다!​&nbsp;</p>',NULL,NULL,0),(21,'글래스','M.나이트 샤말란','스릴러',15,'2D,IMAX',120,'2019-01-17','2019-02-28','movie_1548052341996.jpg',0,'<p>24개의 인격ㆍ강철 같은 신체ㆍ천재적 두뇌</p><p>통제불가한 24번째 인격 비스트를 깨운 케빈,&nbsp;</p><p>강철 같은 신체 능력을 지닌 의문의 남자 던,&nbsp;</p><p>천재적 두뇌를 지닌 미스터리한 설계자 미스터 글래스,&nbsp;</p><p>마침내 그들이 한 자리에 모이게 되고 이들의 존재가 세상에 드러나면서 예상치 못한 일이 벌어지는데…….​&nbsp;</p>',NULL,NULL,0),(22,'주먹왕 랄프 2: 인터넷 속으로','필 존스턴','어린이',1,'2D,IMAX',120,'2019-01-03','2019-02-10','movie_1548052482366.jpg',0,'<p>오락실 게임 세상에 이어</p><p>이번엔 인터넷 세상이 발칵 뒤집힌다?!</p><p>각종 사고를 치며 게임 속 세상을 뒤집어 놨던 절친 주먹왕 ‘랄프’와 ‘바넬로피’는</p><p>버려질 위기에 처한 오락기 부품을 구하기 위해 와이파이를 타고 인터넷 세상에 접속한다.&nbsp;</p><p>&nbsp;</p><p>얼떨결에 올린 동영상으로 순식간에 핵인싸에 등극한 ‘랄프’와</p><p>룰도 트랙도 없는 스릴만점 슬로터 레이스 게임에 참여하게 된 ‘바넬로피’&nbsp;</p><p>&nbsp;</p><p>지금껏 경험한 적 없는 엄청난 스케일과 새로운 재미에 흠뻑 빠진&nbsp;</p><p>‘랄프’와 ‘바넬로피’는 랜섬웨어급 사고로 인터넷 세상을 혼란에 빠뜨리는데…</p><p>&nbsp;</p><p>과연, 이들은 무사히 집에 돌아갈 수 있을까?​&nbsp;</p>',NULL,NULL,0),(23,'극장판 공룡메카드 : 타이니소어의 섬','최신규','어린이',1,'2D',120,'2019-01-10','2019-02-26','movie_1548052645969.jpg',0,'<p>타이니소어로 가득한 환상의 섬에서 펼쳐지는 뜨거운 우정 이야기가 시작된다!</p><p>머나먼 옛날, 소행성 충돌로 인해 지구의 공룡들이 모두 사라지고</p><p>사람들에게 알려지지 않은 어느 작은 섬에서 공룡들은 아주 작은 모습의 타이니소어로 탄생한다.&nbsp;</p><p>씩씩한 트리케라, 장난꾸러기 티라노, 잠꾸러기 스테고 등 타이니소어 친구들이</p><p>도토리 축구를 하며 즐거운 나날을 보내고 있던 중,</p><p>수상한 악당들이 나타나 평화로운 ‘타이니소어의 섬’을 위협하기 시작하는데…&nbsp;</p><p>타이니소어들을 노리는 수상한 눈빛의 정체는?&nbsp;</p><p>과연 이들은 위기에 처한 지상 낙원 ‘타이니소어의 섬’을 지켜낼 수 있을까?​&nbsp;</p>',NULL,NULL,0),(24,'아쿠아맨','제임스 완','액션,판타지',12,'2D,IMAX',120,'2018-12-19','2019-02-14','movie_1548052910690.jpg',0,'<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: 나눔고딕, NanumGothic, 돋움, Dotum, Helvetica, AppleSDGothicNeo-Medium, AppleGothic, sans-serif; font-size: 14px; letter-spacing: -1px;\">땅의 아들이자 바다의 왕, 심해의 수호자인&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: 나눔고딕, NanumGothic, 돋움, Dotum, Helvetica, AppleSDGothicNeo-Medium, AppleGothic, sans-serif; font-size: 14px; letter-spacing: -1px;\">슈퍼히어로 아쿠아맨의 탄생을 그린 액션 블록버스터</span>​</p>',NULL,NULL,0),(25,'그린 북','피터 패럴리','코믹',12,'2D',120,'2019-01-09','2019-02-28','movie_1548053230993.jpg',0,'<p>언제 어디서든 바른 생활! 완벽한 천재 뮤지션 ‘돈 셜리’</p><p>원칙보다 반칙! 다혈질 운전사 ‘토니’</p><p>취향도, 성격도 완벽히 다른 두 남자의 특별한 우정이 시작된다!</p><p>1962년 미국, 입담과 주먹만 믿고 살아가던 토니 발레롱가(비고 모텐슨)는 교양과 우아함 그 자체인&nbsp;</p><p>천재 피아니스트 돈 셜리(마허샬라 알리) 박사의 운전기사 면접을 보게 된다.&nbsp;</p><p>&nbsp;&nbsp;</p><p>백악관에도 초청되는 등 미국 전역에서 콘서트 요청을 받으며 명성을 떨치고 있는 돈 셜리는&nbsp;</p><p>위험하기로 소문난 미국 남부 투어 공연을 떠나기로 결심하고,&nbsp;</p><p>투어 기간 동안 자신의 보디가드 겸 운전기사로 토니를 고용한다.&nbsp;</p><p>&nbsp;&nbsp;</p><p>거친 인생을 살아온 토니 발레롱가와 교양과 기품을 지키며 살아온 돈 셜리 박사.&nbsp;</p><p>생각, 행동, 말투, 취향까지 달라도 너무 다른 두 사람은&nbsp;</p><p>그들을 위한 여행안내서 ‘그린북’에 의존해 특별한 남부 투어를 시작하는데…​&nbsp;</p>',NULL,NULL,0),(26,'왕이 될 아이','조 코니쉬','어린이',1,'2D',120,'2019-01-16','2019-02-15','movie_1548053448593.jpg',0,'<p>히어로의 세.대.교.체!</p><p>어둠이 지배하는 세상, 내가 나설 차례인가?</p><p>마음만은 핵인싸, 현실은 존재감 제로인 소년 ‘알렉스’(루이스 서키스)는&nbsp;</p><p>어느 날 바위에 꽂힌 미스터리한 검을 발견한다.&nbsp;</p><p>득템의 기쁨도 잠시, 다크포스 풍기는 마법 존재들의 공격에서 가까스로 위기를 모면하는데…&nbsp;</p><p>&nbsp;&nbsp;</p><p>알고 보니 그 검은 전설의 레전템 엑스칼리버!&nbsp;</p><p>학교에 나타난 전설의 마법사 ‘멀린’(패트릭 스튜어트)은 ‘알렉스’가 미래를 구할 왕이 될 아이라 말하고,&nbsp;</p><p>그는 친구들을 모아 절대악 ‘모가나’(레베카 퍼거슨)와 그녀의 어둠의 군단과 맞서게 되는데…​&nbsp;</p>',NULL,NULL,0),(27,'보헤미안 랩소디','브라이언 싱어','멜로',12,'2D',120,'2018-10-31','2019-01-28','movie_1548053627505.jpg',0,'<p>“나는 스타가 되지 않을 것이다, 전설이 될 것이다”</p><p>공항에서 수하물 노동자로 일하며 음악의 꿈을 키우던 이민자 출신의 아웃사이더 ‘파록버사라’&nbsp;</p><p>보컬을 구하던 로컬 밴드에 들어가게 되면서 ‘프레디 머큐리’라는 이름으로 밴드 ‘퀸’을 이끌게 된다.&nbsp;</p><p>&nbsp;&nbsp;</p><p>시대를 앞서가는 독창적인 음악과 화려한 퍼포먼스로 관중들을 사로잡으며 성장하던 ‘퀸’은&nbsp;</p><p>라디오와 방송에서 외면을 받을 것이라는 음반사의 반대에도 불구하고&nbsp;</p><p>무려 6분 동안 이어지는 실험적인 곡 ‘보헤미안 랩소디’로 대성공을 거두며 월드스타 반열에 오른다.&nbsp;</p><p>&nbsp;&nbsp;</p><p>그러나 독보적인 존재감을 뿜어내던 ‘프레디 머큐리’는 솔로 데뷔라는 유혹에 흔들리게 되고&nbsp;</p><p>결국 오랜 시간 함께 해왔던 멤버들과 결별을 선언하게 되는데…&nbsp;</p><p>&nbsp;&nbsp;</p><p>세상에서 소외된 아웃사이더에서 전설의 록밴드 ‘퀸’이 되기까지,&nbsp;</p><p>우리가 몰랐던 그들의 진짜 이야기가 시작된다!​&nbsp;</p>',NULL,NULL,0),(28,'스파이더맨 : 뉴 유니버스','밥 퍼시케티','액션',12,'2D',120,'2018-12-12','2019-01-31','movie_1548053775159.jpg',0,'<p>새로운 스파이더맨 평행세계의 시작!</p><p>“스파이더맨은… 우리 말고 얼마나 더 있죠?”</p><p>평범한 10대 ‘마일스 모랄레스’는 우연히 방사능 거미에 물려 스파이더맨 능력을 가지게 된다.&nbsp;</p><p>혼란스러워하던 ‘마일스’는 악당과 싸우고 있는 ‘피터 파커’를 마주치게 되고&nbsp;</p><p>‘피터 파커’는 ‘마일스’가 자신과 같은 능력을 가지고 있음을 직감한다.&nbsp;</p><p>여러 개의 평행세계가 존재한다는 것을 알게 된 ‘마일스’와 ‘피터 파커’는&nbsp;</p><p>이후 스파이더우먼 ‘스파이더 그웬’, ‘스파이더맨 누아르’, ‘스파이더햄’ 등&nbsp;</p><p>평행세계 속 공존하는 모든 스파이더맨들을 만나게 되는데…&nbsp;</p><p>하나의 유니버스에서 만나 팀을 결성한 스파이더맨들은 과연 세계를 구할 수 있을까?&nbsp;</p><p>&nbsp;&nbsp;</p><p>스파이더맨들의 새로운 시대가 열린다!​&nbsp;</p>',NULL,NULL,0),(29,'드래곤 길들이기3','딘 데블로이스','어린이',1,'2D',120,'2019-01-30','2019-02-28','movie_1548057324025.jpg',0,'<p>영원히 기억될 그들의 마지막 모험이 시작된다!</p><p>영원한 친구 히컵과 투슬리스의 활약으로&nbsp;</p><p>사람과 드래곤이 공존하며 평화롭게 살아가는 버크섬.&nbsp;</p><p>새로운 드래곤 ‘라이트 퓨어리’를 쫓아간 투슬리스를 찾다가&nbsp;</p><p>히컵은 누구도 찾지 못했던 드래곤의 파라다이스 ‘히든월드’를 우연히 발견하게 된다.&nbsp;</p><p>하지만 평화도 잠시, 역대 최악의 드래곤 헌터 그리멜의 등장으로&nbsp;</p><p>드래곤들의 안전과 버크섬의 평화까지 위협받기 시작하는데…​&nbsp;</p>',NULL,NULL,0),(30,'알리타 : 배틀엔젤','로버트 로드리게즈','액션,멜로,SF',12,'4D,IMAX',120,'2019-02-05','2019-03-01','movie_1548059278836.jpg',0,'<p>인간의 두뇌를 가진 기계 소녀</p><p>그녀는 인간인가? 기계인가? 진짜 나를 깨워라!</p><p>모두가 갈망하는 공중도시와 그들을 위해 존재하는 고철도시로 나누어진 26세기.&nbsp;</p><p>고철 더미 속 모든 기억을 잃은 채 깨어난 알리타는 마음 따뜻한 의사 이도의 보살핌으로 새로운 삶을 시작한다.&nbsp;</p><p>이도는 사이보그인 알리타에게 특별한 과거의 비밀과 영혼이 존재한다는 사실을 깨닫고&nbsp;</p><p>미스터리한 과거로부터 그녀를 지키고자 한다.&nbsp;</p><p>한편, 새로운 친구 휴고는 알리타가 위험한 고철도시를 헤쳐나갈 수 있는 방법과 함께 기억을 되찾도록 돕는다.&nbsp;</p><p>&nbsp;&nbsp;</p><p>알리타가 자신의 과거에 다가 갈수록 도시를 지배하는 악랄한 세력들이 그녀를 노리며 제거하려고 하고&nbsp;</p><p>자신이 착취와 약탈의 고철도시를 구할 수 있는 열쇠임을 깨닫게 된 알리타는&nbsp;</p><p>사랑하는 가족과 친구, 새로운 세상을 위해 통제된 세상의 무시무시한 적들과 맞서게 되는데…​&nbsp;</p>',NULL,NULL,0),(31,'메리 포핀스 리턴즈','롭 마샬','판타지,가족',1,'2D,IMAX',120,'2019-02-15','2019-04-18','movie_1548061520838.jpg',1,'<p>행복한 상상을 이루어주는 해피메이커 ‘메리 포핀스’</p><p>체리트리 가 17번지에 살고 있는 마이클과 세 아이들은 아내와 엄마를 잃고,&nbsp;</p><p>집까지 빼앗길 위기에 처해 슬픔에 잠긴다.&nbsp;</p><p>어느 날, 바람의 방향이 바뀌고 마이클의 가족에게 다시 돌아온 ‘메리 포핀스’는&nbsp;</p><p>사랑스러운 마법으로 가득 찬 황홀한 경험을 선사하는데…</p><p>&nbsp;</p>',NULL,NULL,0),(33,'뺑반','한준희','액션,범죄',15,'2D',133,'2019-01-30','2019-02-28','movie_1548306212383.jpg',0,'<p>Hit and Run 상황 발생,</p><p>순마 출동합니다!</p><p>경찰 내 최고 엘리트 조직 내사과 소속 경위 ‘은시연’(공효진).&nbsp;</p><p>조직에서 유일하게 믿고 따르는 ‘윤과장’(염정아)과 함께&nbsp;</p><p>F1 레이서 출신의 사업가 ‘정재철’(조정석)을 잡기 위해 수사망을 조여가던 시연은&nbsp;</p><p>무리한 강압 수사를 벌였다는 오명을 쓰고 뺑소니 전담반으로 좌천된다.&nbsp;</p><p>&nbsp;&nbsp;</p><p>알고 보면 경찰대 수석 출신, 만삭의 리더 ‘우계장’(전혜진)과&nbsp;</p><p>차에 대한 천부적 감각을 지닌 에이스 순경 ‘서민재’(류준열).&nbsp;</p><p>팀원은 고작 단 두 명, 매뉴얼도 인력도 시간도 없지만 뺑소니 잡는 실력만큼은 최고인 ‘뺑반’.&nbsp;</p><p>계속해서 재철을 예의주시하던 시연은 뺑반이 수사 중인 미해결 뺑소니 사건의 유력한 용의자가 재철임을 알게 된다.&nbsp;</p><p>&nbsp;&nbsp;</p><p>뺑소니 친 놈은 끝까지 쫓는 뺑반 에이스 민재와&nbsp;</p><p>온갖 비리를 일삼는 재철을 잡기 위해 모든 것을 건 시연.&nbsp;</p><p>하나의 목표를 향해 힘을 합친 그들의 팀플레이가 시작되는 가운데&nbsp;</p><p>방법을 가리지 않고 수사망을 빠져 나가려는 통제불능 스피드광 재철의 반격 역시 점점 과감해지는데…!​&nbsp;</p>',NULL,NULL,0),(35,'저스티스 리그','잭 스나이더','판타지,SF',12,'2D,IMAX',120,'2019-01-28','2019-02-28','movie_1548642298235.jpg',0,'<p><span style=\"color: rgb(34, 34, 34); font-family: \" apple=\"\" sd=\"\" gothic=\"\" neo\",=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" small;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">인류의 수호자인 슈퍼맨이 사라진 틈을 노리고 ‘마더박스’를 차지하기 위해 빌런 스테픈울프가 악마군단을 이끌고 지구에 온다.마더박스는 시간과 공간, 에너지, 중력을 통제하는 범우주적인 능력으로 행성의 파괴마저도 초래하는 물체로 이 강력한 힘을 통제하기 위해 고대부터 총 3개로 분리되어 보관되고 있던 것.인류에 대한 믿음을 되찾고 슈퍼맨의 희생 정신에 마음이 움직인 브루스 웨인은 새로운 동료인 다이애나 프린스에게 도움을 청해 이 거대한 적에 맞서기로 한다.배트맨과 원더 우먼은 새로이 등장한 위협에 맞서기 위해 아쿠아맨, 사이보그, 플래</span><span class=\"yZlgBd\" style=\"display: inline; color: rgb(34, 34, 34); font-family: \" apple=\"\" sd=\"\" gothic=\"\" neo\",=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" small;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">시를 찾아 신속히 팀을 꾸린다.이들 슈퍼히어로 완전체는 스테픈울프로부터 마더박스를 지키기 위해 지구의 운명을 건 전투를 벌인다!</span>​</p>',NULL,NULL,0),(36,'쉬리','강제규','액션,드라마,스릴러',15,'2D,IMAX',123,'2019-01-28','2019-02-28','movie_1548407777479.jpg',0,'<p><span style=\"background-color: rgb(245, 245, 245); color: rgb(55, 58, 60); font-family: \" open=\"\" sans\",=\"\" arial,=\"\" \"apple=\"\" sd=\"\" gothic=\"\" neo\",=\"\" \"noto=\"\" sans=\"\" cjk=\"\" kr\",=\"\" 본고딕,=\"\" \"kopubdotum=\"\" medium\",=\"\" 나눔바른고딕,=\"\" 나눔고딕,=\"\" nanumgothic,=\"\" 맑은고딕,=\"\" \"malgun=\"\" gothic\",=\"\" sans-serif;=\"\" font-size:=\"\" 14.4px;=\"\" font-weight:=\"\" 700;\"=\"\">1999년 일급 프로젝트</span></p><br style=\"box-sizing: inherit; color: rgb(55, 58, 60); font-family: \" open=\"\" sans\",=\"\" arial,=\"\" \"apple=\"\" sd=\"\" gothic=\"\" neo\",=\"\" \"noto=\"\" sans=\"\" cjk=\"\" kr\",=\"\" 본고딕,=\"\" \"kopubdotum=\"\" medium\",=\"\" 나눔바른고딕,=\"\" 나눔고딕,=\"\" nanumgothic,=\"\" 맑은고딕,=\"\" \"malgun=\"\" gothic\",=\"\" sans-serif;=\"\" font-size:=\"\" 14.4px;=\"\" background-color:=\"\" rgb(245,=\"\" 245,=\"\" 245);\"=\"\"><span style=\"color: rgb(55, 58, 60); font-family: \" open=\"\" sans\",=\"\" arial,=\"\" \"apple=\"\" sd=\"\" gothic=\"\" neo\",=\"\" \"noto=\"\" sans=\"\" cjk=\"\" kr\",=\"\" 본고딕,=\"\" \"kopubdotum=\"\" medium\",=\"\" 나눔바른고딕,=\"\" 나눔고딕,=\"\" nanumgothic,=\"\" 맑은고딕,=\"\" \"malgun=\"\" gothic\",=\"\" sans-serif;=\"\" font-size:=\"\" 14.4px;=\"\" background-color:=\"\" rgb(245,=\"\" 245,=\"\" 245);\"=\"\">국가 비밀기관 OP의 특수요원인 중원(한석규)과 장길(송강호)은 최근 일어난 암살 사건을 수사 중이다. 제보를 약속한 무기밀매상 보스 임봉주가 눈앞에서 저격당하자, 둘은 저격 스타일을 보고 북한 특수요원 이방희가 활동을 재개했음을 안다.&nbsp;</span><br style=\"box-sizing: inherit; color: rgb(55, 58, 60); font-family: \" open=\"\" sans\",=\"\" arial,=\"\" \"apple=\"\" sd=\"\" gothic=\"\" neo\",=\"\" \"noto=\"\" sans=\"\" cjk=\"\" kr\",=\"\" 본고딕,=\"\" \"kopubdotum=\"\" medium\",=\"\" 나눔바른고딕,=\"\" 나눔고딕,=\"\" nanumgothic,=\"\" 맑은고딕,=\"\" \"malgun=\"\" gothic\",=\"\" sans-serif;=\"\" font-size:=\"\" 14.4px;=\"\" background-color:=\"\" rgb(245,=\"\" 245,=\"\" 245);\"=\"\"><br style=\"box-sizing: inherit; color: rgb(55, 58, 60); font-family: \" open=\"\" sans\",=\"\" arial,=\"\" \"apple=\"\" sd=\"\" gothic=\"\" neo\",=\"\" \"noto=\"\" sans=\"\" cjk=\"\" kr\",=\"\" 본고딕,=\"\" \"kopubdotum=\"\" medium\",=\"\" 나눔바른고딕,=\"\" 나눔고딕,=\"\" nanumgothic,=\"\" 맑은고딕,=\"\" \"malgun=\"\" gothic\",=\"\" sans-serif;=\"\" font-size:=\"\" 14.4px;=\"\" background-color:=\"\" rgb(245,=\"\" 245,=\"\" 245);\"=\"\"><span style=\"color: rgb(55, 58, 60); font-family: \" open=\"\" sans\",=\"\" arial,=\"\" \"apple=\"\" sd=\"\" gothic=\"\" neo\",=\"\" \"noto=\"\" sans=\"\" cjk=\"\" kr\",=\"\" 본고딕,=\"\" \"kopubdotum=\"\" medium\",=\"\" 나눔바른고딕,=\"\" 나눔고딕,=\"\" nanumgothic,=\"\" 맑은고딕,=\"\" \"malgun=\"\" gothic\",=\"\" sans-serif;=\"\" font-size:=\"\" 14.4px;=\"\" background-color:=\"\" rgb(245,=\"\" 245,=\"\" 245);\"=\"\">북에서는 이방희의 특수교관이었던 박무영(최민식)이 북한 특수 8군단과 함께 내려오고 유중원과 이장길은 최근의 암살이 국방부에서 개발한 CTX와 관련이 있다는 사실을 알게 된다. 이를 깨달은 둘은 국방과학 연구소로 향하지만 이미 박무영이 CTX를 탈취한 상태다.&nbsp;</span><br style=\"box-sizing: inherit; color: rgb(55, 58, 60); font-family: \" open=\"\" sans\",=\"\" arial,=\"\" \"apple=\"\" sd=\"\" gothic=\"\" neo\",=\"\" \"noto=\"\" sans=\"\" cjk=\"\" kr\",=\"\" 본고딕,=\"\" \"kopubdotum=\"\" medium\",=\"\" 나눔바른고딕,=\"\" 나눔고딕,=\"\" nanumgothic,=\"\" 맑은고딕,=\"\" \"malgun=\"\" gothic\",=\"\" sans-serif;=\"\" font-size:=\"\" 14.4px;=\"\" background-color:=\"\" rgb(245,=\"\" 245,=\"\" 245);\"=\"\"><br style=\"box-sizing: inherit; color: rgb(55, 58, 60); font-family: \" open=\"\" sans\",=\"\" arial,=\"\" \"apple=\"\" sd=\"\" gothic=\"\" neo\",=\"\" \"noto=\"\" sans=\"\" cjk=\"\" kr\",=\"\" 본고딕,=\"\" \"kopubdotum=\"\" medium\",=\"\" 나눔바른고딕,=\"\" 나눔고딕,=\"\" nanumgothic,=\"\" 맑은고딕,=\"\" \"malgun=\"\" gothic\",=\"\" sans-serif;=\"\" font-size:=\"\" 14.4px;=\"\" background-color:=\"\" rgb(245,=\"\" 245,=\"\" 245);\"=\"\"><p><span style=\"background-color: rgb(245, 245, 245); color: rgb(55, 58, 60); font-family: \" open=\"\" sans\",=\"\" arial,=\"\" \"apple=\"\" sd=\"\" gothic=\"\" neo\",=\"\" \"noto=\"\" sans=\"\" cjk=\"\" kr\",=\"\" 본고딕,=\"\" \"kopubdotum=\"\" medium\",=\"\" 나눔바른고딕,=\"\" 나눔고딕,=\"\" nanumgothic,=\"\" 맑은고딕,=\"\" \"malgun=\"\" gothic\",=\"\" sans-serif;=\"\" font-size:=\"\" 14.4px;\"=\"\">항상 적은 한 발 앞서 OP의 상황을 알게되고 OP 내부에서는 서로를 의심하게 된다. 명현(김윤진)과 결혼을 앞둔 중원은 명현을 피신시키는데...</span>&nbsp;</p>',NULL,NULL,0),(37,'극한직업','이병헌','멜로',15,'2D',111,'2019-01-23','2019-02-28','movie_1548812486425.jpg',0,'<p><strong class=\"blind\" style=\"font-family: 나눔고딕, NanumGothic, 돋움, Dotum, Helvetica, AppleSDGothicNeo-Medium, AppleGothic, sans-serif; clip: rect(0px, 0px, 0px, 0px); overflow: hidden; position: absolute; top: 0px; left: 0px; width: 1px; height: 1px; font-size: 0px; line-height: 0; display: inline !important;\">줄거리</strong></p><h5 class=\"h_tx_story\" style=\"margin: -7px 0px 1px; padding: 0px; background-image: url(\" https:=\"\" ssl.pstatic.net=\"\" static=\"\" movie=\"\" 2014=\"\" 01=\"\" blank.gif\");=\"\" font-size:=\"\" 14px;=\"\" font-family:=\"\" 나눔고딕,=\"\" nanumgothic,=\"\" helvetica,=\"\" sans-serif;=\"\" letter-spacing:=\"\" -1px;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" line-height:=\"\" 25px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">낮에는 치킨장사! 밤에는 잠복근무!<br>지금까지 이런 수사는 없었다!</h5><p class=\"con_tx\" style=\"margin-top: -1px; margin-bottom: -6px; background-image: url(\" https:=\"\" ssl.pstatic.net=\"\" static=\"\" movie=\"\" 2014=\"\" 01=\"\" blank.gif\");=\"\" position:=\"\" relative;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 25px;=\"\" letter-spacing:=\"\" -1px;=\"\" font-family:=\"\" 나눔고딕,=\"\" nanumgothic,=\"\" 돋움,=\"\" dotum,=\"\" helvetica,=\"\" applesdgothicneo-medium,=\"\" applegothic,=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">불철주야 달리고 구르지만 실적은 바닥, 급기야 해체 위기를 맞는 마약반!<br>&nbsp;더 이상 물러설 곳이 없는 팀의 맏형 고반장은 국제 범죄조직의 국내 마약 밀반입 정황을 포착하고<br>&nbsp;장형사, 마형사, 영호, 재훈까지 4명의 팀원들과 함께 잠복 수사에 나선다.<br>&nbsp;마약반은 24시간 감시를 위해 범죄조직의 아지트 앞 치킨집을 인수해 위장 창업을 하게 되고,<br>&nbsp;뜻밖의 절대미각을 지닌 마형사의 숨은 재능으로 치킨집은 일약 맛집으로 입소문이 나기 시작한다.<br>&nbsp;수사는 뒷전, 치킨장사로 눈코 뜰 새 없이 바빠진 마약반에게 어느 날 절호의 기회가 찾아오는데…<br>&nbsp;&nbsp;</p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: 나눔고딕, NanumGothic, 돋움, Dotum, Helvetica, AppleSDGothicNeo-Medium, AppleGothic, sans-serif; font-size: 14px; letter-spacing: -1px;\">&nbsp;범인을 잡을 것인가, 닭을 잡을 것인가!</span>&nbsp;</p>',NULL,NULL,0),(38,'사바하','장재현','스릴러',15,'2D',122,'2019-02-20','2019-03-28','movie_1548914243362.jpg',0,'<p>신흥 종교 비리를 찾아내는 종교문제연구소 ‘박목사’(이정재).&nbsp;</p><p>최근 사슴동산이라는 새로운 종교 단체를 조사 중이다.&nbsp;</p><p>영월 터널에서 여중생이 사체로 발견되는 사건이 발생하고&nbsp;</p><p>이를 쫓던 경찰과 우연히 사슴동산에서 마주친 박목사는 이번 건이 심상치 않음을 직감한다.&nbsp;</p><p>터널 사건 유력 용의자의 자살, 그리고 실체를 알 수 없는 정비공 ‘나한’(박정민)과&nbsp;</p><p>16년 전 태어난 쌍둥이 동생 ‘금화’(이재인)의 존재까지,&nbsp;</p><p>사슴동산에 대해 파고들수록 박목사는 점점 더 많은 미스터리와 마주하게 되는데…!&nbsp;</p><p>&nbsp;&nbsp;</p><p>그것이 태어나고 모든 사건이 시작되었다​&nbsp;</p>',NULL,NULL,0);

#
# Structure for table "notice"
