  `res_state` int(1) unsigned NOT NULL DEFAULT '0' COMMENT '예매상태"1=예매완료","2=예매취소"',
  `res_num` varchar(15) NOT NULL DEFAULT '0' COMMENT '예매번호',
  PRIMARY KEY (`no`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 COMMENT='예매';

